import React from 'react';
import '../styles/RouterPanel.css'

const RouterPanel = (props) => {

  const RouterList = () => {
    let list = [];
    const label = {
      width: 30,
      height: 10,
      backgroundColor: 'Chartreuse',
      marginLeft: 15
    };

    for(let key in props.routers){
      list.push(
        <div className='Router'>
          <canvas style={label}/>

          {props.routers[key].name}
        </div>
      )
    }
    return list;
  };


  return  (
            <div className='List'>
              <RouterList />
            </div>
          );
};

export default RouterPanel;
